    @Override
    public void onCreate() {
        initializeSQLCipher();
        super.onCreate();
        Util.log("Getting instance ");
        instance = this;
        if (mExternalDirectoryPath == null) {
            mExternalDirectoryPath = this.getExternalFilesDir(null).toString();
        }
        mLogger = new OpenMRSLogger();
        OpenMRSDBOpenHelper.init();
        initializeDB();
        AndroidSnooper.init(this);
        // catch exception when the service is already  running
        try {
            Intent i = new Intent(this, FormListService.class);
            startService(i);
            if (Build.VERSION.SDK_INT < Build.VERSION_CODES.P) {
                Intent intent = new Intent(this, AuthenticateCheckService.class);
                startService(intent);
            }
        }catch (Exception e){
       // app is in background
            Log.e(Util.TAG,"Loading form and encounter type Stop "+e.getMessage());
            OpenMRSCustomHandler.writeLogToFile(e.getMessage());

        }
    }

    protected void initializeDB() {
        Configuration.Builder configurationBuilder = new Configuration.Builder(this);
        configurationBuilder.addModelClasses(Link.class);
        configurationBuilder.addModelClasses(FormResource.class);
        configurationBuilder.addModelClasses(EncounterType.class);
        configurationBuilder.addModelClasses(Encountercreate.class);
        configurationBuilder.addModelClasses(Obscreate.class);
        configurationBuilder.addModelClasses(ObscreateLocal.class);
        configurationBuilder.addModelClasses(Facility.class);
        configurationBuilder.addModelClasses(States.class);
        configurationBuilder.addModelClasses(Lga.class);
        configurationBuilder.addModelClasses(Department.class);
        configurationBuilder.addModelClasses(Item.class);
        configurationBuilder.addModelClasses(ItemBatch.class);
        configurationBuilder.addModelClasses(Consumption.class);
        configurationBuilder.addModelClasses(Destination.class);
       // configurationBuilder.addModelClasses(FingerPrintLog.class);

        ActiveAndroid.initialize(configurationBuilder.create());

        populateDestination();
        populatePharmacy();
        try {
            List<States> states = new Select()
                    .from(States.class)
                    .execute();
            //List<Destination> destinations = new Select().from(Destination.class).execute();
            //if(destinations.)
            if (states.isEmpty()) {
                populateFacility();
                populateLga();
                populateState();
                populateItem();
                populateDepartment();
            }
        } catch (Exception e) {
            mLogger.i(e.toString());
        }

    }

